INSERT INTO `producto` (`id_producto`, `nombre`, `descripcion`, `detalle`, `stock`, `precio_unit`, `cantidad`, `estado_producto`, `fk_categoria`) VALUES
	(1, 'Laptop Toshiba C840-sp4225kl 500gb Disco Duro 4 Gb Ram Ddr3', 'Toshiba, más resolución y mejora de audio.\r\n\r\nToshiba tecnología de televisión que inmediatamente aumenta la calidad de las películas, para imágenes más nítidas y colores más vibrantes. Además de eso, con la tecnología Toshiba accesorio de audio, usted puede disfrutar de su música favorita con una calidad de audio nítida y clara incluso en entornos ruidosos.\r\n\r\n14.0 ""WXGA HD SuperView AMD y gráfica dedicada\r\n\r\nLa última Toshiba Satellite C840 viene con el apoyo AMD Dedicado gráficos, se puede disfrutar de un rendimiento gráfico excelente para trabajar y jugar, ya sea para disfrutar de películas o hacer múltiples tareas. Dependiendo de su configuración.\r\n\r\nCaracterísticas\r\n\r\nIntel Core i3-2370M 2.40GHz de 2 núcleos\r\nDisco duro de 500GB\r\nMemoria cache de 3MB\r\nMemoria RAM de 4GB\r\nMemoria RAM tipo DDR3 SDRAM\r\nSistema operativo Windows 7 Home Basic\r\nProcesador gráfico Intel HD Graphics\r\nCámara web HD integrada de 1.3mpx\r\nMicrófono integrado\r\nPantalla con retroiluminación LED TDT LCD de 14""\r\nResolución de pantalla de 1366 X 768 pixeles\r\nInterfaces para entrada de micrófono, auricular, una entrada en combo para cables VGA y LAN, dos puertos USB 2.0\r\nConectividad Wi-Fi 802.11 b/g/n de alta velocidad', 'Laptop Toshiba C840-SP4225KL', 'si', 11499, 20, 'nuevo', 7),
	(2, 'Vendo Macbook Blanca 2.2ghz 4gb Ram Muy Conservada!!', 'MACBOOK BLANCA PROCESADOR 2.2GHZ INTEL CORE 2 DUO VERSION 10.6.8, CON 4 GB DE RAM EN EXCELENTES CONDICIONES CARCASA INTACTA NO PARTIDA NI REPARADA INCLUYE SU CAJA ORIGINAL, CABLES CARGADORES, CDS CON SISTEMA OPERATIVO ORIGINAL LEOPARD, CONTROL REMOTO EN SU BOLSA AUN SIN ABRIR.\r\n\r\nVENDO POR NO USAR\r\n\r\nDETALLE EN UNIDAD DE CD, PERO INCLUYO UNIDAD DE DVD/CD QUEMADOR EXTERNA MARCA SAMSUNG SUPER RAPIDA.', 'Vendo Macbook Blanca', 'si', 11000, 1, 'usado', 7),
	(3, 'Ultraportatil Samsung Chromebook Wi Fi', 'Las Últimas Que Quedan a precio viejo aprovecha \r\n\r\n¿Qué es un Chromebook?\r\n\r\nUn chromebook es una computadora ultradelgada, rápida y fácil de administrar que no tiene capacidad de almacenamiento propia, sino que aprovecha los recursos de “la nube” para ello. Corren el sistema operativo Chrome y arrancan en tan sólo 8 segundos, con lo cual no desperdicias tu tiempo. Gracias a la larga duración de la batería, es posible trabajar un día entero sin tener que cargar la Chromebook.\r\n\r\nEn Empresas preocupadas por la seguridad de sus datos, las Chromebook permiten a los empleados conectarse a través de las herramientas de oficina que ofrece la nube, sincronizadamente, optimizando los procesos de IT y tareas de mantenimiento de las computadoras.\r\n\r\nEn Centros Educativos, permiten dedicar todo el tiempo a las tareas de aprendizaje, trasladando las herramientas y potentes recursos de Internet directamente a los alumnos.\r\n\r\nLos administradores configuran y administran las Chromebook y las cuentas de los usuarios de forma centralizada a través de la Web. Y como el sistema operativo corre por cuenta de Google, éste mantiene las actualizaciones centralizadas y sin tener que estar bajando parches de seguridad. Los datos almacenados en estas computadoras, son mínimos. Y  el sistema operativo Chrome, es el que se encarga de la prevención de ataques de virus o malware y de brindar esta protección.\r\n\r\nSi ya te encuentras utilizando alguno de los sistemas de cloud computing como Salesforce, SAP, Gmail, Google Apps, Assistly, etc, la migración es instantánea, pues sólo tienes que coectarte a tu plataforma vía web y listo!\r\n\r\nPeso: 1.13 Kg.\r\n\r\n•  0.8” de espesor.\r\n•  6 horas de autonomía.\r\n•  Salida HDMI.\r\n•  Dos puertos USB 3.0 y 2.0.\r\n•  Lector SD.•WiFi.\r\n•  100GB de almacenamiento “en la nube”\r\n•  16GB de almacenamiento.\r\n•  2GB de memoria DRAM.\r\n\r\n                     Entre el resto de especificaciones más importantes, tenemos una pantalla LED de 11.6 pulgadas, con resolución 1366×768 píxeles, 2GB de memoria RAM, y 16GB para almacenamiento en formatoSSD. La batería es de 4080mAh, que proporciona una autonomía de algo más de 6 horas.\r\n                     NO OFERTE SI NO ESTA SEGURO DE LA COMPRA\r\nGoogle Chrome\r\n\r\nProcessor\r\nCPU / Processor\r\nSamsung Exynos 5 Duall\r\nCPU Clock Speed (Max.)\r\n1.7GHz\r\nCPU Caché\r\n1MB\r\nModel\r\nModel Number\r\nXE303C12-A01US\r\n \r\nDisplay\r\nScreen Size\r\n11.6""\r\n\r\nTipo\r\nLED HD\r\nResolution\r\n1366 x 768\r\n\r\nBrightness\r\n200 nits\r\n\r\nMemoria\r\nStandard System Memoria\r\n2GB\r\n\r\nMemoria Tipo\r\nDDR3L\r\n\r\nStoragee\r\n\r\nHard Drive\r\n16GB\r\nRPM\r\neMMC\r\n\r\nGraphics\r\nExternal o Integrated\r\nIntegrated\r\nMaximum Graphics Memoria\r\n\r\nMultimedia\r\nSpeaker\r\n3W Stereo Speaker (1.5W x 2)\r\nInternal Mic\r\nYes\r\n\r\nWeb Camera\r\n0.3 MP\r\n\r\nConnectivity\r\nWirelessLAN\r\n802.11 a/b/g/n\r\n\r\nI/O Ports\r\nVGA\r\nYes (Available only with dongle sold separately)\r\nHDMI\r\nYes\r\nUSB Ports\r\n1 x USB 3.0 + 1 x USB 2.0\r\nHeadphone Out\r\nYes (Headphone/MIC combo)\r\nMicrophone In\r\nYes (Headphone/MIC combo)\r\nMulti Card Slot\r\n\r\n3- in-1 (SD/SDHC/SDXC', 'Las Últimas Que Quedan A Precio Viejo Aprovecha', 'si', 6900, 10, 'nuevo', 7),
	(4, 'Macbook 13¨ Intel Core2 Duo 2.26 Ghz Blanca 4gb Ram', 'Macbook Intel Core2 Duo 2.26 GHz Blanca 4gb RAM\r\n\r\nNVIDIA GeForce 9400M\r\nPantalla LED Widescreen de 13 pulgadas\r\nExcelente estado, unico dueño, perfecto rendimiento + mouse\r\nCon su caja original\r\nCargador y extension\r\nTodos los programas de Apple pregrabados\r\nCD con software original (x2)\r\n\r\nProcesadores:  1 (2 Cores)  Geekbench:  3205/3513 *\r\nVelocidad del procesador:  2,26 GHz  Tipo de procesador:  Core 2 Duo (P7550)\r\nDetalles:  El Intel ""Core 2 Duo"" (P7550) 45 nm ""Penryn"" procesador incluye dos procesadores independientes ""núcleos"" en un chip de silicio.\r\nVelocidades personalizadas:  N / A  Arquitectura:  64-Bit\r\nActualización de procesador:  Soldado  FPU:  Integrado\r\nSistema de Velocidad del bus:  1066 MHz  Caché Velocidad del bus:  2,26 GHz (Built-in)\r\nROM / Firmware Tipo:  EFI  EFI Arquitectura:  64-Bit\r\nCaché L1:  32k/32k  L2/L3 Cache:  3 MB (en el chip)\r\nRAM Tipo:  PC3-8500 DDR3  Min. RAM Velocidad:  1066 MHz\r\nDetalles:  Soporta 1066 MHz PC3-8500 DDR3 SDRAM.\r\nRAM estándar:  4 GB  Máximo RAM:  8 GB *\r\nDetalles:  Instala como dos módulos de 4 GB, no hay ranuras libres. \r\n\r\nMotherboard RAM:  Ninguno  RAM Slots:  2\r\nTarjeta de vídeo:  GeForce 9400M  VRAM Tipo:  Integrado\r\nDetalles:  Este modelo tiene una NVIDIA GeForce 9400M que comparte la memoria con el sistema.\r\nEstándar VRAM:  256 MB  Máximo VRAM:  256 MB\r\nPantalla incorporada:  13.3 ""Widescreen  Resolución nativa:  1280x800\r\nDetalles:  13.3 ""panorámica color TFT de matriz activa con retroiluminación LED de"" brillante ""de pantalla con una resolución de 1280 x 800 resolución nativa de Apple. Informa que también es compatible con"" 1.152 por 720, 1.024 por 768, 1.024 por 640, 800 por 600, 800 por 500, 720 por 480 y 640 por 480 píxeles con una relación dimensional de 16:10; 1024 por 768, 800 por 600 y 640 por 480 píxeles con una relación dimensional de 4:3; [y] 720 por 480 píxeles con una relación dimensional de 3:2 "" . \r\n\r\nSoporte de pantallas segundo:  Dual / Mirroring  Max 2 ª. Resolución:  2560x1600\r\nDetalles:  La resolución máxima admitida en una pantalla externa es 2560x1600.\r\nUnidad de disco duro estándar:  250 GB (5400 RPM)  Int. HD Interfaz:  Serial ATA (3 Gb / s)\r\nEstándar óptica:  8x DL ""SuperDrive""  Disco estándar:  Ninguno\r\nDetalles:  Apple reporta que este slot-loading ""SuperDrive"" (DVD ± R DL / DVD ± RW / CD-RW) tiene una velocidad de escritura maxium de ""8x DVD-R, DVD + R, 4x DVD-R DL (doble capa), DVD + R DL (doble capa), DVD-RW, DVD + RW, 24x CD-R, 10x CD-RW ""y una velocidad máxima de lectura de"" 8x DVD-R, DVD + R, DVD-ROM, 6x DVD-ROM (doble capa DVD-9), DVD-R DL (doble capa), DVD + R DL (doble capa), DVD-RW y DVD + RW, 24x CD "".\r\nMódem estándar:  Ninguno  Estándar Ethernet:  10/100/1000Base-T\r\nAirPort estándar:  802.11a/b/g/n  Estándar de Bluetooth:  2.1 + EDR\r\nPuertos USB:  2 (2.0)  Puertos FireWire:  Ninguno\r\nDetalles:  Dos 480-Mbps puertos USB 2.0.\r\nDetalles:  No hay ranuras de expansión o bahías proporcionada.\r\nIncl. Teclado:  De tamaño completo  Incl. De entrada:  Trackpad (4 dedos)\r\nTipo de Caso:  Cuaderno  Factor de forma:  MacBook (White Unibody)\r\nManzana Número de orden:  MC207LL / A  Manzana Subfamilia:  Finales de 2009\r\nApple Modelo No:  A1342 (EMC 2350 *)  Modelo ID:  MacBook6, 1\r\nDetalles:  Para más información sobre estos identificadores y la manera de localizar en cada Mac, consulte EveryMac.com s Identificación de Mac sección.\r\nTipo de batería:  60 W h Li-Poly  Duración de la batería:  7 Horas\r\nPre-instalado MacOS:  X 10.6.1 (10A2047)  Máximo MacOS:  * Corriente\r\nVentanas mínimos:  XP SP2 (32-Bit) *  Máximo Windows:  7 (64-bit) **\r\nMacOS 9 Soporte:   Compatibilidad con Windows:  Boot / Virtualización\r\nDimensiones:  1,08 x 13,00 x 9,12  AVG. Peso:  4,7 libras (2,13 kg)', 'Excelente Estado, Unico Dueño, Perfecto Rendimiento + Mouse', 'si', 11500, 1, 'usado', 7),
	(5, 'Apple Macbook Core 2 Duo Dd120 2 Ram 2.16 Ghz Nav12', 'Apple Macbook Core 2 Duo  DD120 2RAM  2.16 GHZ 13.3"" esta a toda prueba.   ENVIO Y ENTREGA:\r\n\r\nPOR MRW,ZOOM CON FLETE PREPAGO\r\n\r\nEL COMPRADOR DEBE SUMARLE AL PRECIO DEL PRODUCTO EL COSTO DEL FLETE Y TASA POSTAL POR MRW,ZOOM\r\n\r\nASI SE TE ENVIA YA CON EL FLETE PAGO\r\n\r\nUNA VEZ CONFIRMADO EL DEPOSITO, EL PRODUCTO SERA ENVIADO EN LA MAYORIA DE LOS CASOS EN 2 DIAS HABILES A MAS TARDAR.EN CASO DE ENVIO EL PRODCUTO SOLO SERA ENVIADO A LA OFICINA DE MRW MAS CERCANA AL DOMICILIO O TRABAJO DEL COMPRADOR PARA QUE LA PASE BUSCANDO', 'Apple Macbook Core 2 Duo Dd120 2 Ram 2.16 Ghz 13.3', 'si', 8800, 1, 'usado', 7),
	(6, 'Mini Laptop 7 Pulg Wm8650 Android 2.2 Usb 3g Cpu 800 Mhz', 'Nuevo Modelo en Oferta!!!\r\n\r\n\r\nMini Laptop Netbook 7 Pulgadas WM 8650\r\nAndroid 2.2 + CPU 800 Mhz + 4gb Memoria\r\nWifi + 3g + 512MB RAM + RJ45 + USB\r\n\r\nDISPONIBLE EN VARIOS COLORES, PREGUNTAR ANTES DE OFERTAR', 'Aceptamos Tarjetas De Debito Y Credito Somos Tienda En Sabana Grande', 'si', 2090, 100, 'nuevo', 7),
	(7, 'Laptop Lenovo G580 Intel I3 4gb 500gb 15.6 Led Portatil W8', 'Laptop Lenovo G580\r\n\r\nProcesador Intel Core i3 - 3110M 2.4GHz\r\nMemoria Ram 4GB DDR3\r\nDisco Duro de 500GB\r\nPantalla de 15.6"" HD LED\r\nQuemadora DVD\r\nLector de tarjetas 2 en 1\r\nWifi 802.11n\r\nIntel HD 4000 Graphics\r\nPuertos USB 3.0 / 2.0\r\nCamara Web (720p HD)\r\n\r\nLa última tecnología a un precio asequible\r\n\r\nLa Lenovo G580(r) Es una portátil asequible que no compromete, ofrece un rendimiento excepcional para las tareas diarias, gracias a la 3a generación de Intel (r) Core i3, 4GB de memoria RAM y espacio para almacenamiento de 500GB de disco que le permite almacenar gran cantidad de información, imágenes, música y videos.\r\n\r\nTambién cuenta con OneKey Rescue System (r), una cómoda herramienta que hace copias de seguridad y recuperación de datos rápida y fácil.', 'Windows 8 , I3 De Tercera Generacion, Modelo 2013, Nuevas Con Garantia', 'si', 15299, 25, 'nuevo', 7),
	(8, 'Dell Precicion M6500 Core I7, 16gb Ram, Ati Fire Pro, Nav12', 'Rendimiento incomparable\r\n\r\nConozca la workstation móvil más potente. La Dell Precision M6500 se destaca donde otras workstations móviles comienzan a perder potencia.\r\n\r\nCon especificaciones que algunas workstations de escritorio apenas podrían ofrecer, la workstation móvil emblemática de Dell es una elección ideal para los usuarios más exigentes.\r\n\r\nWindows® 7 Professional Discover virtually unlimited creative power with optional Intel® Core i7 Extreme Edition Quad Core processors, which work in harmony with 1333MHz or 1600MHz DDR3 memory and stunning ATI® FirePro® or NVIDIA® Quadro FX graphics to support your talent.\r\n\r\nEscalabilidad masiva\r\n\r\nIncreíble capacidad de ampliación y flexibilidad. El rendimiento sin procesar es sólo una parte, la Dell Precision M6500 también tiene la capacidad de administrar grandes volúmenes de datos.\r\nWindows 7 Professional\r\nAladmitir cuatro ranuras de memoria DIMM, la M6500 permite una escalabilidad de memoria de hasta 16 GB. Con dos compartimentos de disco duro dedicados y una minitarjeta SSD adicional (¡Próximamente!), la capacidad de almacenamiento de la M6500 puede escalarse hasta más de 1 terabyte y puede ser configurada en modo RAD?5 para operar con alto rendimiento y redundancia.\r\nNumerosas opciones le brindan la flexibilidad para configurar la Dell Precision M6500 exactamente como lo desea. Elija una pantalla opcional integral RGB de LED de 17"" que admite 100% del espectro de colores de Adobe® seleccionables por el usuario, una cámara opcional de 2 MP o un panel multitáctil con ajuste gradual y utilice su workstation como lo desee.', 'Extra Credito Mercantil Y Banesco, Workstation, 500gb Hdd, 17 Led', 'si', 27850, 10, 'nuevo', 7),
	(9, 'Laptop Siragon Nb3100 Dd 500 Gb Ram 4gb Amd Dual Core', 'Vive tu vida digital de forma brillante\r\nSu innovador diseño con una llamativa tapa exterior semejante a un metal pulido hacen de la NB-3100 una espectacular opción, ya que está hecha pensando en una tendencia vanguardista para ofrecer un producto de gran calidad para aquellos que desean una laptop única en su estilo y que sea el centro de todas las miradas.\r\n\r\nConvierte tus pasatiempos en experiencias\r\ncon gráficos nítidos y brillantes.\r\nElimina prácticamente las esperas en la\r\ntransmisión de vídeos de alta definición.\r\nNavega por Internet a una velocidad increíble\r\ny termina tus tareas con facilidad.\r\nEs tu vida digital, tu manera de vivir,\r\ncon la tecnología VISION de AMD\r\n\r\nLa vida en imágenes\r\nTu laptop NB-3100 te permite disfrutar de todos tus contenidos personales de Alta Definición, ya sean tus peliculas, videos ó fotos en una pantalla grande con una simple conexión HDMI para disfrutar de video y audio con solo conectar un cable.\r\n\r\nAdemás la NB-3100 te permite disfrutar de contenidos multimedia con impecables imágenes mediante diversas tecnologías avanzadas para gráficos, que facilitan la reproducción optimizada de video en alta definición y proporcionan una calidad de imagen superior\r\n\r\nConversa con quien quieras\r\nCasi oculta en la parte superior de la pantalla de la\r\nlaptop NB-3100, hay una VivoCam que podrás usar\r\npara tomar fotos y grabar videos. Lo mejor de\r\ntodo es que no debes perder tiempo valioso\r\ninstalando software o configurando la cámara,simplemente funciona desde el\r\nprimer momento.\r\n\r\nGarantía Síragon\r\nLas laptops Síragon son sometidas a exigentes pruebas de control de calidad durante su proceso de ensamblaje ofreciendo a nuestros clientes un Certificado de Garantía por un año de duración.', 'Somos Tienda Fisica Garantia 1 Año Estamos En Sabana Grand Ry1computes', 'si', 8999, 13, 'nuevo', 7),
	(10, 'Brazalete Antiestatica El Que Si Funciona!, Envio Economico!', 'Mosca!!!!! LAS PULSERAS INALAMBRICAS NO FUNCIONAN!!\r\n\r\nPuedes buscarlo en Internet. Las pulseras antiestaticas inalambricas son una estafa... no hay forma de que las cargas pasen a tierra sin un conductor que la lleve a tierra.\r\n\r\nLa estatica es una carga electrica que se acumula en el cuerpo con el simple hecho de caminar, y que al tocar un componente electronico lo daña al instante.\r\n\r\nSi trabajas con electronicos es indispensable que tengas uno y se detendran esas muertes subitas de partes y componentes que servian y de repente dejaron de servir!\r\n\r\nSe coloca con el caiman en un metal como el case de la computadora y listo!.\r\n\r\nVienen con un broche que permite desconectar el cable de la muñeca sin sacarse la pulsera.', 'Pulsera Anti Estatica Esd, Mejora Tu Desempeño Electronico', 'si', 65, 20, 'nuevo', 7);
